import React from 'react';
import './css/Code.css';

const CodingWork = () => {
  const handleRedirect = () => {
    window.location.href = '/coding-work'; // Redirect to the Coding Work page
  };

  return (
    <div className="coding-work-container">
      <div className="coding-work-tile" onClick={() => window.location.href='/coding-work'}>
        <img src="your-image-url" alt="Project 1" />
        <div className="coding-work-content">
          <h2>Project Title 1</h2>
          <p>Description about Project 1 goes here...</p>
        </div>
      </div>
      <div className="coding-work-tile" onClick={() => window.location.href='/coding-work'}>
        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fgithub.com%2Flogos&psig=AOvVaw0BIY-b78JnXAc8NRVnZH2g&ust=1723054076156000&source=images&cd=vfe&opi=89978449&ved=0CBEQjRxqFwoTCMDWzuX64IcDFQAAAAAdAAAAABAE" alt="Project 2" />
        <div className="coding-work-content">
          <h2>Project Title 2</h2>
          <p>Description about Project 2 goes here...</p>
        </div>
      </div>
      <div className="coding-work-tile" onClick={() => window.location.href='/coding-work'}>
        <img src="your-image-url" alt="Project 3" />
        <div className="coding-work-content">
          <h2>Project Title 3</h2>
          <p>Description about Project 3 goes here...</p>
        </div>
      </div>
      <button className="show-more" onClick={handleRedirect}>
        Show More
      </button>
    </div>
  );
};

export default CodingWork;
